In this episode we learn some rocket science with NASA engineer, @yourfemaleengineer and how you apply math to rocket design. This is an honor of today’s historic launch of the @inspiration4 and @spacex. What is the most dangerous phase of a launch? What systems are being monitored for safety? We had lots of questions and more. 

