@fernsulantay talks about making a dream come true. In partnership with @papayatutor, @fernsulantay is founding and hosting her own Engineering Competition Challenge. She participated in 3 of them, and now that she is in a position to help, she wants to pay it forward. 

This episode of WISW is brought to you by @papayatutor where any complex subject can be explained to a 5-year old. 
